In C, there are two types of variables: automatic variables and static variables.
Automatic variables:
Automatic variables are the normal variables that we declare inside a function. They are created on the stack when the function is called and destroyed when the function returns. Each time the function is called, a new copy of the variable is created.
Example:
```c
void foo() {
    int x = 10;
    printf("%d\n", x);
}
```
In this example, `x` is an automatic variable. Each time `foo()` is called, a new copy of `x` is created and initialized to 10.

Static variables:
Static variables are variables that are declared with the `static` keyword. They are created only once, when the program starts, and retain their value between function calls.
Example:
```c
void foo() {
    static int x = 10;
    printf("%d\n", x);
    x++;
}
```
In this example, `x` is a static variable. It is created only once, when the program starts, and retains its value between function calls. Each time `foo()` is called, the value of `x` is incremented.

Register variables:
Register variables are a type of automatic variable that is stored in a CPU register instead of on the stack. They are declared with the `register` keyword.
Example:
```c
void foo() {
    register int x = 10;
    printf("%d\n", x);
}
```
In this example, `x` is a register variable. It is stored in a CPU register instead of on the stack.

