import http from 'http';
import { PostModel } from './post.model';

const server = http.createServer((req, res) => {
  if (req.method === 'POST' && req.url === '/post') {
    const { content, image, name } = req.body;
    const post = new PostModel({ content, image, name });
    post.save((err, post) => {
      if (err) {
        res.statusCode = 500;
        res.end('Error creating post');
      } else {
        res.statusCode = 201;
        res.end('Post created successfully');
      }
    });
  } else {
    res.statusCode = 404;
    res.end('Not found');
  }
});

server.listen(3000, () => {
  console.log('Server listening on port 3000');
});
```
