function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length * 7 / 8);
  const view = new Uint8Array(buffer);
  let offset = 0;

  for (const entity of entities) {
    const id = entity.id & 0xF; // 4 bits
    const size = entity.size & 0x7; // 3 bits
    const byte = (id << 3) | size;
    view[offset++] = byte;
    if (offset % 8 === 0) {
      offset = Math.floor(offset / 8);
    }
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new Uint8Array(buffer);
  const entities = [];
  let offset = 0;

  while (offset < view.length) {
    const byte = view[offset++];
    const id = (byte >> 3) & 0xF; // 4 bits
    const size = byte & 0x7; // 3 bits
    entities.push({ id, size });
  }

  return entities;
}
```
Here's an explanation of the implementation:

The `packEntities` function creates an `ArrayBuffer` with a size that is the ceiling of the total number of bits required to store all entities divided by 8. It then creates a `Uint8Array` view of the buffer.

The function then iterates over the entities, packing each entity's `id` and `size` fields into a single byte. The `id` field is shifted left by 3 bits to make room for the `size` field, and the `size` field is bitwise OR'd with the `id` field. The resulting byte is written to the `Uint8Array` view.

The `unpackEntities` function creates a `Uint8Array` view of the input `ArrayBuffer`. It then iterates over the bytes in the view, unpacking each byte into an entity's `id` and `size` fields. The `id` field is extracted by shifting the byte right by 3 bits and masking with `0xF`, and the `size` field is extracted by masking the byte with `0x7`. The unpacked entity is then added to the result array.

Note that this implementation assumes that the input entities have `id` and `size` fields that fit within the 4-bit and 3-bit ranges, respectively. If the input entities have larger fields, the packing and unpacking functions will need to be modified accordingly.

