function timeSince(date: Date): string {
  const now = new Date();
  const elapsed = now.getTime() - date.getTime();
  const minutes = Math.floor(elapsed / 60000);
  const hours = Math.floor(elapsed / 3600000);
  const days = Math.floor(elapsed / 86400000);

  if (days > 0) {
    return `${days} days ago`;
  } else if (hours > 0) {
    return `${hours} hours ago`;
  } else if (minutes > 0) {
    return `${minutes} minutes ago`;
  } else {
    return 'just now';
  }
}
```

This function calculates the elapsed time in milliseconds, then converts it to minutes, hours, and days. It then checks which unit of time is the most appropriate to display, and returns a string in the format "X [unit] ago". If the elapsed time is less than 1 minute, it returns "just now".



